import './App.css';
import { Container, Row, Col, Button } from 'reactstrap';

function App() {
  return (
    <>
      <Container className="themed-container">
      <Row>
            <Col className="p-5 text-center">
        <Button color="primary" className="d-flex align-items-center">primary</Button>
        </Col></Row>
      </Container>
    </>
  );
}

export default App;
